    rows, cols = [int(n) for n in stdin.strip().split()]

    grid = [[0] * cols for _ in range(rows)]

    for i, line in enumerate(stdin.strip().splitlines()):
        for j, c in enumerate(line):
            grid[i][j] = c

    def is_valid_position(x: int, y: int) -> bool:
        if x < 0 or x >= rows or y < 0 or y >= cols:
            return False

        return grid[x][y]!= "*"

    def _is_valid_position(x: int, y: int) -> bool:
        return (
            0 <= x < rows and 0 <= y < cols and grid[x][y] == "."
        ) or (
            0 <= x < rows and 0 <= y < cols and grid[x][y] == "*"
        )

    def _draw_star(size: int, x: int, y: int) -> None:
        for dx in range(-size + 1, size):
            for dy in range(-size + 1, size):
                if dx == 0 and dy == 0:
                    continue

                if _is_valid_position(x + dx, y + dy):
                    grid[x + dx][y + dy] = "*"

    def _draw_stars(size: int, x: int, y: int) -> None:
        for dx in range(-size + 1, size):
            for dy in range(-size + 1, size):
                if dx == 0 and dy == 0:
                    continue

                if _is_valid_position(x + dx, y + dy):
                    grid[x + dx][y + dy] = "*"
                    _draw_stars(size - 1, x + dx, y + dy)

    _, star_count = solve(grid)

    if star_count > rows * cols:
        return "-1"

    return str(star_count) + "\n" + "\n".join(
        " ".join(str(c) for c in line) for line in grid
    )


