    for _ in range(m):
        u, v = [int(i) - 1 for i in stdin.split()]
        nodes[u].append(v)
        nodes[v].append(u)
    d = [0 for _ in range(n)]
    d[0] = 1
    visited = set()
    def get_path(u: int, w: int) -> int:
        if d[u] == d[w]:
            return d[u]
        visited.add(u)
        for v in nodes[u]:
            if v == w:
                return d[u] + 1
            if v not in visited:
                return max(get_path(v, w), d[u] + 1)
    for u in range(n):
        for v in nodes[u]:
            if u not in visited:
                d[u] = max(d[u], get_path(u, v))
    return str(d[n - 1])


