    grid = [[int(s) for s in stdin.split()] for _ in range(4)]
    # initialze the first move
    move = int(stdin.split()[-1])
    while move:
        # count the number of empty cells
        empty = 0
        for row in grid:
            empty += row.count(0)
        # if only one empty cell, merge to a new tile
        if empty == 1:
            row, col = [row.index(0) for row in grid].pop()
            for i, row in enumerate(grid):
                if 0 in row:
                    row[row.index(0)] = 2 * grid[i][col]
                    grid[i][col] = 0
                    break
        # if no empty cell, slide
        else:
            for _ in range(4):
                for row in grid:
                    for i in range(1, len(row)):
                        if row[i - 1] == row[i] and row[i]!= 0:
                            row[i - 1] += row[i]
                            row[i] = 0
        # if tile does not merge with other tile, move to next tile
        for row in grid:
            for i in range(len(row) - 2, -1, -1):
                if row[i] == row[i + 1] and row[i]!= 0:
                    row[i] *= 2
                    row[i + 1] = 0
        move -= 1
    return '\n'.join(' '.join(str(row.pop(0)) for row in grid) for grid in zip(*grid))

