    The maximum possible number of strings that can be hung from a rod of length n is n*(n+1)/2, which is O(n^2)

    so the maximum possible number of strings that can be hung from a rod of length n is n*(n+1)/2.
    if we are given that a set of n triangles have side lengths a, b and c then the maximum number of strings that can be hung from a rod of length n is n*(n+1)/2 - a*b*c*(n-1)

    so if we know the number of triangles, we can derive the maximum number of strings that can be hung from a rod of length n, the formula would be n*(n+1)/2 - n*(n-1)/2
