    def neighbours(row, col) -> list:
        n = len(matrix)
        neighbour = []
        if row > 0:
            neighbour.append(matrix[row - 1][col])
        if row < n - 1:
            neighbour.append(matrix[row + 1][col])
        if col > 0:
            neighbour.append(matrix[row][col - 1])
        if col < n - 1:
            neighbour.append(matrix[row][col + 1])
        return neighbour

    def bfs(start: tuple) -> int:
        dist = {}
        to_visit = deque()
        to_visit.append(start)
        dist[start] = 0
        while to_visit:
            current = to_visit.popleft()
            if current[0] == k:
                return dist[current]
            neighbour = neighbours(current[0], current[1])
            for neighbour in neighbour:
                if neighbour in dist and dist[neighbour] > dist[current] + 1:
                    dist[neighbour] = dist[current] + 1
                    to_visit.append(neighbour)
        return -1

    # for row in range(n):
    #     print(matrix[row])
    # print('------')
    # print(bfs((0, 0)))
