    size_x, size_y = int(size_x), int(size_y)
    matches = [int(x) for x in stdin.strip().split(' ')]
    matches.sort()
    matches.reverse()

    # No matter how big the box is, any match will fit
    # Therefore, the longest match is the last one
    max_match_len = matches[0]

    # Take all matches, start with the longest, and check each match against the box size
    # If it fits, there is no match to the box size
    # If it does not fit, take the matching match, and put it in the box
    # Keep doing this until there are no matches to be checked
    # If all of the matches fit, then the box is full
    # Otherwise, the box is not full
    while matches:
        match_len = matches.pop()
        if match_len <= size_x and match_len <= size_y:
            return "DA"
        if match_len > size_x or match_len > size_y:
            matches.append(match_len)
            matches.sort()
            matches.reverse()
    return "NE"


